import React from 'react';
import Layout from '../components/Layout';

const Profile: React.FC = () => (
  <Layout>
    <h2>마이페이지</h2>
    <p>여기서 내 정보와 학습 기록을 확인할 수 있습니다.</p>
  </Layout>
);

export default Profile;
